import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Board from './components/Board';



function App() {
  return (
    <BrowserRouter>
      <Heade />
      <Routes>
        <Route path={"/board"} element={<Board />}/>
      </Routes>
      <Board />
    </BrowserRouter>
  );
}

export default App;
